import React, { useState } from "react";
import { Box } from "@mui/material";
import { TextField } from "@mui/material";
import { Paper } from "@mui/material";
import { Button } from "@mui/material";
import CreateIcon from "@mui/icons-material/Create";

function Kysely1() {
  const [kysely, setValues] = useState({
    kentta1: "",
    kentta2: "",
    kentta3: "",
    kentta4: "",
    kentta5: "",
  });

  const [viesti, setViesti] = useState("");

  const kysely1 = (e) => {
    setValues({
      kentta1: "",
      kentta2: "",
      kentta3: "",
      kentta4: "",
      kentta5: "",
    });

    setViesti("Kiitos vastauksista!");
  };

  return (
    <Box>
      <Paper sx={{ padding: "10px", margin: "10px" }}>
        <Box
          component="form"
          sx={{ "& .MuiTextField-root": { m: 1, width: "25ch" } }}
        >
          <TextField required id="outlined-yhtye" label="Mikä on paras yhtye?" />
          <TextField required id="outlined-kappale" label="Mikä on paras musiikkikappale?" />
          <TextField required id="outlined-elokuva" label="Mikä on paras elokuva?" />
          <TextField required id="outlined-ruoka" label="Mikä on paras ruoka?" />
          <TextField required id="outlined-urheilulaji" label="Mikä on paras urheilulaji?" />
        </Box>
        <Box sx={{ textAlign: "center" }}>
          <Button
            onClick={(e) => kysely1(e)}
            variant="contained"
            sx={{ marginRight: 3 }}
            startIcon={<CreateIcon />}
          >
            Lisää
          </Button>
        </Box>
      </Paper>
    </Box>
  );
}
export default Kysely1;
